function Footeris(props) {
  return (
    <footer className={props.klase} style={props.stilius}>
      {props.pavadinimas && props.pavadinimas}
      <ul>
        {props.elementai.map((item, index) => (
          <li key={index}>{item}</li> ,{/* Add a unique key for each list item */}
        ))}
      </ul>
    </footer>
  );
}
